import React from 'react';

const Login = () => {
    const [values, setValues] = useState({
        username: '',
        password: '',
     })
  return (
    <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>
      <div className='bg-white p-3 rounded w-25'>
        <form action="">
          <div className='mb-3'>
            <label htmlFor='username' style={{ fontFamily: 'wotfard', fontSize: '20px', padding: '10px' }}>
              username
            </label>
            <input type='username' placeholder='enter username' style={{ fontFamily: 'wotfard', color: 'black', border: '1px solid #ced4da', borderRadius: '5px', padding: '5px' }} />
          </div>
          <div className='mb-3'>
            <label htmlFor='password' style={{ fontFamily: 'wotfard', fontSize: '20px', padding: '10px' }}>
              password
            </label>
            <input type='password' placeholder='enter password' style={{ fontFamily: 'wotfard', color: 'black', border: '1px solid #ced4da', borderRadius: '5px', padding: '5px' }} />
          </div>
          <button className='btn btn-success' style={{ fontFamily: 'wotfard', fontSize: '20px', backgroundColor: 'rgb(217, 229, 238)', padding: '5px' }}>log in</button>
          <p>don't already have an account?</p>
          <button className='btn btn-default border' style={{ fontFamily: 'wotfard', fontSize: '20px', backgroundColor: 'rgb(217, 229, 238)', padding: '5px' }}>create one</button>
        </form>
      </div>
    </div>
  );
};

export default Login;
